void customprint(uint32_t *in, int size)
{
    int32_t i;

    printf("0x");
    printf("%0x", in[size - 1]);
    for (i = size - 1; i >= 0; i--) {
    	xil_printf("%08x", in[i]);
    }
    xil_printf("\n\r");
}



